import React from "react";

function Home() {
  return (
    <div className="home">
      <div class="container">
        <div class="row align-items-center my-5">
          <p> Welcome to Professor Marvin - Your Simple and Effective Study Tool!</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
